(258, 'elementor_remote_info_feed_data', 'a:3:{i:0;a:5:{s:5:\"title\";s:58:\"New Features: Revamped Video Features & Custom Breakpoints\";s:7:\"excerpt\";s:181:\"This week, you’ll have the chance to discover other helpful features that were introduced: Video enhancements, custom breakpoints, Gutenberg compatibility, and WP-CLI integration.\";s:7:\"created\";s:10:\"1531227695\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:111:\"https://elementor.com/2-1-new-features/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:35:\"Introducing Copy Style & Copy Paste\";s:7:\"excerpt\";s:190:\"We\'re excited to release one of the most requested features: Copy Style & Copy Paste. This will save you hours of work, allowing you to quickly copy any style or element with a single click.\";s:7:\"created\";s:10:\"1530613662\";s:5:\"badge\";s:3:\"New\";s:3:\"url\";s:117:\"https://elementor.com/introducing-copy-paste/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:36:\"Introducing Single & Archive Builder\";s:7:\"excerpt\";s:234:\"Single & Archive builder lets you design blogs just like you always imagined. By visually designing your blog without code, you can complete projects lightning-fast, and get full control over your blog design right at your fingertips.\";s:7:\"created\";s:10:\"1527679763\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:117:\"https://elementor.com/single-archive-builder/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
