ourself.org\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">HowToKillYourself.org<\\/a>, with the message of \\u201cYou\\u2019re not alone.\\u201d The hope she found helped her get through the night.<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"46b34fb0\",\"elType\":\"section\",\"settings\":{\"gap\":\"extended\",\"content_position\":\"middle\",\"background_background\":\"classic\",\"background_color\":\"#f5f5f5\",\"padding\":{\"unit\":\"px\",\"top\":\"100\",\"right\":\"0\",\"bottom\":\"100\",\"left\":\"0\",\"isLinked\":false}},\"elements\":[{\"id\":\"f7a7227\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null,\"space_between_widgets\":0},\"elements\":[{\"id\":\"4d651766\",\"elType\":\"widget\",\"settings\":{\"title\":\"What we do\",\"header_size\":\"h3\",\"align\":\"center\",\"typography_typography\":\"custom\",\"typography_text_transform\":\"uppercase\",\"_margin\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"10\",\"left\":\"0\",\"isLinked\":false}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"5b751239\",\"elType\":\"widget\",\"settings\":{\"color\":\"#d65050\",\"width\":{\"unit\":\"px\",\"size\":50},\"align\":\"center\",\"gap\":{\"unit\":\"px\",\"size\":0},\"_margin\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"50\",\"left\":\"0\",\"isLinked\":false}},\"elements\":[],\"widgetType\":\"divider\"},{\"id\":\"1344f3d\",\"elType\":\"section\",\"settings\":{\"structure\":\"20\"},\"elements\":[{\"id\":\"6d4c85a\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":61.802},\"elements\":[{\"id\":\"1fbbf795\",\"elType\":\"widget\",\"settings\":{\"title_text\":\"Identify Issues\",\"description_text\":\"Use analytics to determine common harmful phrases people search online\",\"icon\":\"fa fa-search\",\"view\":\"framed\",\"position\":\"left\",\"primary_color\":\"#d65050\",\"icon_space\":{\"unit\":\"px\",\"size\":30},\"icon_size\"