(202, 1, '2018-07-12 18:00:18', '2018-07-12 18:00:18', '<h3>Our story</h3>		\n		<h4>Suicide Prevention with <a href=\"http://howtokillyourself.org\">HowToKillYourself.org</a></h4><p>It started with a number: 6,000. The number of times the phrase “how to kill yourself” is Googled every month in Canada. One of the top results is “7 painless ways to kill yourself.” When that reality was shared at a FaithTech Hackathon, a team of people with a desire to change that came together to do something. That weekend they worked to create a live website linked to helpful resources.</p><p>Within months of the website’s release, one of the team members discovered that, during a time of darkness, a friend had been searching for “how to kill yourself”. Through her search, this friend came to <a href=\"http://howtokillyourself.org\" target=\"_blank\" rel=\"noopener\">HowToKillYourself.org</a>, with the message of “You’re not alone.” The hope she found helped her get through the night.</p>		\n			<h3>What we do</h3>		\n				<h3>\n					Identify Issues\n				</h3>\n				<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aenean ipsum enim.</p>\n				<h3>\n					Create Projects\n				</h3>\n				<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aenean ipsum enim.</p>\n				<h3>\n					Develop Websites\n				</h3>\n				<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aenean ipsum enim.</p>\n				<h3>\n				</h3>\n				<p></p>\n				0\n							Monthly Visitors\n			<h3>Do you want to...</h3>		\n			<h3>Take some time and meet our Employees?</h3>		\n			<a href=\"#\" role=\"button\">\n						Meet the team\n					</a>\n			<h3>Take some time and meet our Employees?</h3>		\n			<a href=\"#\" role=\"button\">\n						Meet the team\n					</a>\n			<h3>Our team</h3>		\n							Monthly Visits\n							Websites\n							Customers\n							Awards\n			<h3>What our clients say</h3>		\n			<h3>Our work</h3>		\n			<h3>Who we are</h3>		\n		<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut el